function * enqueue(value) {
    yield 0

	grapher.push(value);
    const lastIndex = grapher.getValues().length - 1;
    grapher.setNodeModeSelected(lastIndex);

    yield {
        line: 1,
        comment: value + " was added to the bottom of the queue"
    }

    grapher.setNodeModeNone(lastIndex);
}

function * dequeue() {
    yield 3

    grapher.setNodeModeSelected(0);

    yield 4

    const value = grapher.shift();

  	yield 5

    yield {
        line: 6,
        comment: value + " was removed from the top of the queue"
    }
}

function * isEmpty() {
    yield 8
    const valuesCount = grapher.getValues().length;

    yield {
        line: 9,
        comment: (valuesCount == 0) 
            ? "true (the queue is empty)"
            : "false (the queue contains " + valuesCount + " element" + (valuesCount == 1) ? "" : "s" 
    }
}

function * peek() {
    yield 11 
    const values = grapher.getValues();
    yield 12
     if (values.length > 0) {
       	yield {
          line: 14,
          comment: values[0] + " is at the top of the queue"
        }
	} else {
         yield 13
    }
}
